    false,nt"url": null,nt"notes": "This annual narrative report details the
    conditions and management of San Francisco Bay National Wildlife Refuge in 1978.
     The report begins with a general description of the refuge and information about
    climate and habitat conditions for the year.  Land acquisition and the system status
    are also discussed.  The next section of the report covers construction and maintenance
    projects for the year.  Habitat management is described in the third section with
    an emphasis on wetland habitat.  Wildlife is discussed next; special detail is given
    to endangered species, waterfowl, marsh birds, shorebirds, mammals, and non-migratory
    birds.   The fifth section of the report deals with interpretative and recreational
    activities on the refuge.  Finally, field investigations and cooperative programs
    are discussed.",nt"license_title": "License Not Specified",nt"extras":
